def __new__(cls, *args, **kwargs):
    instance = object.__new__(cls)
    if '_instances' not in cls.__dict__:
        cls._instances = WeakSet()
    if '_lock' not in cls.__dict__:
        cls._lock = TqdmDefaultWriteLock()
    with cls._lock:
